Aprovado com alterações apresentadas pelo autor.
Informações requeridas após a aprovação das alterações:
1. O valor da despesa discricionária (RP 2 e 3) autorizada na Lei Orçamentária para o exercício de 2018 por Instituição Federal de Ensino Superior;
2. O valor contingenciado de orçamento discricionário (RP 2 e 3) para cada Instituição Federal de Ensino Superior, após avaliação do primeiro bimestre de 2018, de acordo com o Decreto 9.323/2018;
3. O valor contingenciado de orçamento discricionário (RP 2 e 3) para cada Instituição Federal de Ensino Superior, após avaliação do primeiro bimestre de 2019, de acordo com o Decreto 9.741/2019; e
4. O valor executado em cada Instituição Federal de Ensino Superior até o momento com os recursos discricionários previstos para o exercício de 2019.

Aprovado requerimento n. 9/2020 do Sr. Vinicius Poit que requer realização de audiência pública para discussão sobre "Definição legal de startups: parâmetros e/ou critérios de definição".
Sugiro que sejam convidados, para apreciação do tema, os seguintes convidados:
a) Amure Pinho da Rocha e Silva, Associação Brasileira de Startups.
b) Igor Manhães Nazareh, Subsecretário de Inovação no Ministério da Economia;
c) Rodolfo Fucher, Presidente da ABES - Associação Brasileira de Empresas de Software;
d) Representante da Câmara e-Net;
e) Representante da Associação de Mobilidade e Tecnologia (AMOBITEC); e 
f) Rodrigo "Kiko" Afonso, Dínamo.

